INSERT INTO `banner` VALUES (1,'Nuestro Ministro TIC los invita a participar del Sello de Excelencia','','El Ministro TIC David Luna Sánchez invita a todas las entidades públicas a postular sus productos y\r\nservicios digitales para obtener el Sello de Excelencia, así como a todos los miembros de la\r\nacademia, industria TI, organizaciones internacionales y a toda la ciudadanía en general para que\r\nhagan parte de la Comunidad de evaluadores y garantes de la calidad de estos productos y así\r\nentre todos, construyamos una Colombia más transparente, eficiente y participativa.','https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/Video%20Invitaci%C3%B3n%20Sello%20de%20Excelencia%20Ministro%20TIC.mp4','',1,0,2),(2,'','<p>El Sello de Excelencia Gobierno Digital es un modelo de madurez que garantiza y certifica la alta calidad de los productos y servicios digitales de las entidades públicas del Estado Colombiano.</p>\r\n\r\n<p>Con el objetivo de fortalecer las prácticas democráticas y legitimar cada vez más el sistema político, el Ministerio de TIC, a través de la Dirección de Gobierno Digital, busca la evolución hacia un gobierno más eficiente, transparente y participativo en donde los ciudadanos y las empresas aumenten la confianza y colaboren con la administración para generar valor público. Para cumplir con este objetivo es necesario que los más altos estándares de calidad sean implementados en los productos y servicios que presta el Estado, y es bajo este contexto, que se plantea y comienza a desarrollar el modelo del Sello de Excelencia Gobierno Digital. </p>\r\n\r\n<p>El Sello de Excelencia fue creado a través del decreto 2573 de 2014 y adoptado en la resolución 2405 de 2016, en donde se define como un modelo de certificación que busca garantizar la alta calidad de los servicios digitales del Estado Colombiano. El Sello de Excelencia está organizado en 3 categorías: </p>\r\n<ol>\r\n<li>Categoría servicios en línea: Certifica la calidad de los trámites y servicios en línea. </li>\r\n\r\n<li>Categoría gobierno abierto: Certifican los conjuntos de datos abiertos y los ejercicios de participación por medios digitales. </li>\r\n\r\n<li>Categoría capacidades de Gestión de TI: Certifica las capacidades institucionales y operativas de las entidades públicas. </li>\r\n</ol>\r\n<video style=\"background-color:#000;\" src=\"https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/video%20Sello%20de%20%20Excelencia%20Gobierno%20Digital%20VFINAL.mp4\" controls></video>\r\n\r\n<p>La iniciativa plantea crear una comunidad virtual, la cual estará conformada por academia, industria TI, ciudadanos, entidades públicas y organizaciones internacionales. La Comunidad tendrá la posibilidad de interactuar bajo un esquema de colaboración abierto, participativo y transparente, en donde de manera dinámica se logrará validar los servicios digitales postulados. </p>\r\n\r\n<p>Para activar este importante componente del proyecto, se tiene definida una estrategia de incentivos a través de un modelo de gamificación que pretenda vincular, estimular la permanencia y motivar la participación activa de los actores en los roles que les correspondan (usuarios o expertos).</p>\r\n\r\n<p>El Sello implica diferentes dimensiones de diálogo virtual, que busca potencializar y facilitar los procesos participativos y reducir las barreras que impiden el involucramiento de los diferentes actores en el sector público. Además, logrará incentivar el uso y aprovechamiento de los servicios digitales del Estado, garantizando altos estándares de calidad. </p>\r\n','El Sello de Excelencia Gobierno Digital es un modelo de madurez que garantiza y certifica la alta calidad de los productos y servicios digitales de las entidades públicas del Estado Colombiano.\r\n',NULL,'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/Banner2-Que%CC%81%20es%20el%20Sello.jpg',2,1,1),(3,'Conoce las categorías y productos certificables con el Sello de Excelencia ',' <p>El Sello de Excelencia Gobierno Digital está organizado en tres categorías: servicios en línea, \r\n capacidades de gestión de TI y Gobierno abierto. \r\n </p>  \r\n \r\n <ol> \r\n <img style=\"width:100px; height:auto;\" src=\'http://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/imagen3.1-Capacidades%20de%20Gestio%CC%81n%20TI.png\'/>\r\n <li>\r\n    <p>\r\n    Categoría capacidades de gestión de TI: Consiste en certificar las capacidades institucionales en gestión de TI que desarrollan las entidades para demostrar su habilidad de aprovechar adecuadamente la tecnología al interior de la institución y proporcionar servicios a ciudadanos bajo esquemas de eficiencia y seguridad\r\n    </p>\r\n</li> \r\n<img style=\"width:100px; height:auto;\" src=\'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/imagen3.2-Datos%20abiertos.png\'/> \r\n    <img style=\"width:100px; height:auto;\" src=\'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/imagen3.3-Participacio%CC%81n.png\'/>  \r\n <li>\r\n    <p>Categoría gobierno abierto: Certifica conjuntos de datos abiertos y ejercicios de participación por medios digitales. Con la certificación de los conjuntos de datos se busca poner a disposición de los ciudadanos datos de calidad que puedan ser usados como catalizador de nuevas aplicaciones, servicios y por lo tanto transformar modelos actuales de TI. Con la certificación de ejercicios de participación por medios digitales, se busca fortalecer la democracia participativa a través de mecanismos digitales en doble vía.  </p>\r\n </li> \r\n <img style=\"width:100px; height:auto;\" src=\'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/imagen%203.4.png\'/>  \r\n <li>\r\n    <p>Categoría servicios en Línea: Define los requisitos de calidad de los trámites y servicios en línea que ofrecen las entidades del Estado tanto en el orden nacional como territorial en cuanto a disponibilidad, seguridad, soporte, acceso, usabilidad e interoperabilidad de cara a la experiencia del usuario.</p>\r\n</li> \r\n </ol>','El Sello de Excelencia Gobierno Digital está organizado en tres categorías: servicios en línea, capacidades de gestión de TI y Gobierno abierto. \r\n',NULL,'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/Banner3-Categori%CC%81as%20del%20Sello.jpg',3,1,2),(4,'Conoce los beneficios del Sello de Excelencia ','<p>Beneficios para las entidades:</p>\r\n<ul style=\"padding-left:40px;\">\r\n<li style=\"list-style-type: disc;\">Genera una ventaja competitiva para las Entidades Públicas que logren implementar y certificar el Sello de Excelencia respecto a las demás, ya que pueden demostrar ante los ciudadanos que su producto funciona de una manera que permite el logro de resultados y demuestran que son competentes en las funciones que realizan.</li>\r\n\r\n<li style=\"list-style-type: disc;\">Mejoramiento en la eficiencia y eficacia de los productos y sistemas de gestión ofrecidos por el Estado ya que se maximiza la productividad de los funcionarios públicos, preparándolos para realizar su trabajo satisfactoriamente.</li>\r\n\r\n<li style=\"list-style-type: disc;\">Asegura el Cumplimiento de la Legislación nacional y la que corresponda a cada Entidad Pública. </li>\r\n\r\n<li style=\"list-style-type: disc;\">Se logra obtener un aumento de la calidad del producto y se desarrolla una cultura interna de constante mejora de los procesos.</li>\r\n</ul>\r\n<b>Beneficios para los ciudadanos:</b>\r\n<ul style=\"padding-left:40px;\">\r\n<li style=\"list-style-type: disc;\">Aumenta la confianza de los ciudadanos en las Entidades Públicas y legitima los procesos de las mismas, ya que  garantiza que el producto satisfaga las necesidades de los ciudadanos. </li>\r\n\r\n<li style=\"list-style-type: disc;\">Certifica la calidad de los servicios en línea que ofrece el Estado garantizando una constante interacción, realimentación y aprendizaje en doble vía. </li>\r\n\r\n<li style=\"list-style-type: disc;\">El ciudadano es actor central para la evaluación de los productos a través de comunidades virtuales, en la que generará constante interacción y aprendizaje.  </li>\r\n\r\n<li style=\"list-style-type: disc;\">Se busca que la gestión pública sea completamente visible y que permita realizar acciones de control social. </li>\r\n\r\n<li style=\"list-style-type: disc;\">Acceso a información clara, completa y segura. </li>\r\n\r\n<li style=\"list-style-type: disc;\">Garantía de trámites más sencillos y servicios más rápidos y seguros.</li>\r\n</ul>\r\n','Los beneficios del Sello de Excelencia te motivarán como entidad y ciudadano para adoptar la calidad y hacer uso de los servicios digitales del Estado Colombiano.\r\n',NULL,'https://storage.googleapis.com/domoti-sellodeexcelencia.appspot.com/banner/Banner4-Beneficios%20del%20Sello.jpg',4,1,3),(5,'12',NULL,'12',NULL,NULL,1,1,2);
