--
-- Table structure for table `evaluation_request`
--

DROP TABLE IF EXISTS `evaluation_request`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `evaluation_request` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) DEFAULT NULL COMMENT 'Id del evaluador',
  `id_answer` int(11) DEFAULT NULL COMMENT 'id relacional del requisito',
  `id_service` int(11) DEFAULT NULL,
  `id_request_status` int(11) DEFAULT NULL,
  `id_question` int(11) DEFAULT NULL,
  `timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `result` tinyint(4) DEFAULT NULL,
  `branch` int(11) DEFAULT NULL,
  `justify_reject` text,
  `alert_time` date DEFAULT NULL,
  `end_time` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_evaluation_request_user` (`id_user`),
  KEY `FK_user_form_request_status` (`id_request_status`),
  KEY `FK_user_form_service` (`id_service`),
  KEY `FK_evaluation_request_user_answer` (`id_answer`),
  KEY `FK_evaluation_request_question_idx` (`id_question`),
  CONSTRAINT `FK_evaluation_request_question` FOREIGN KEY (`id_question`) REFERENCES `question` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_evaluation_request_user` FOREIGN KEY (`id_user`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_evaluation_request_user_answer` FOREIGN KEY (`id_answer`) REFERENCES `user_answer` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_user_form_request_status` FOREIGN KEY (`id_request_status`) REFERENCES `request_status` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_user_form_service` FOREIGN KEY (`id_service`) REFERENCES `service` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2354 DEFAULT CHARSET=utf8 COMMENT='Se usa para guardar cuando un evaluador ha sido invitado a evaluar un servicio';
/*!40101 SET character_set_client = @saved_cs_client */;

