INSERT INTO `question` VALUES (1,3,1,'La entidad identifica y prioriza el conjunto de datos para su publicación.','Información recurrente y pertinente orientada a identificar el valor generado para sus usuarios. En ese sentido, el valor público puede ser identificado en los siguientes ámbitos:  • Financiero: Impacto actual o futuro de ingresos, valor de activos, pasivos o cualquier otro aspecto relacionado con la riqueza y el riesgo. • Político: Impacto en una persona o un grupo de influencia o partidos políticos como producto de la acción del gobierno o su política. • Social: Impacto en las relaciones con la comunidad o familias, en la movilidad social, estatus o identidad. • Estratégico: Impacto en personas o grupos económicos relevantes en sus objetivos y recursos para la innovación o el planeamiento. • Ideológico: Impacto en las creencias, en la moral o en los compromisos éticos en la sociedad. • Legitimidad y Respeto: Impacto a nivel de la confianza, integridad y legitimidad de entidades públicas y privadas.  ','Cifras, informes u otra información relevante, en donde se demuestre que el conjunto de datos publicado sea de alto impacto por considerarse de alto interés para el usuario o que su publicación haya sido producto de solicitudes recurrentes. Ejemplo: número de PQRS recibidas.','Ley 1712 de 2014, artículo 11, numeral k. Información mínima obligatoria respecto a servicios, procedimientos y funcionamiento del sujeto obligado. Decreto 103 de 2015, artículo 11. Publicación de datos abiertos. Guía para la apertura de datos abiertos en Colombia, pág 18 http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf  ','',1),(2,4,2,'El conjunto de datos cumple con los principios de legalidad para su publicación.','La Información del conjunto de datos no es de carácter clasificada ni reservada.','La entidad deberá soportar que en el registro de activos de información, la información del conjunto de datos se encuentra relacionada como de caracter público.','Ley 1712 de 2014, artículos 13, 18 y 19. Decreto 103 de 2015, art. 38  Decreto 1081 de 2015, art. 2.1.1.5.1.1 Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf ','Se entiende como información clasificada aquella información pública cuyo acceso libre puede causar daño de derechos a personas naturales o jurídicas.  Se entiende como información reservada la información pública cuyo acceso libre puede causar daño a los intereses públicos.',1),(3,2,1,'El conjunto de datos está completo y disponible en lotes.','El conjunto de datos no contiene espacios sin diligenciar y contiene la información de manera detallada.','Verificar que el conjunto de datos no contenga espacios sin diligenciar y la información se encuentre consolidada en un solo conjunto de datos agrupando todas las vigencias.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf NTC 4611 ','ayuda',1),(4,2,1,'El conjunto de datos está actualizado.','El conjunto de datos debe estar actualizado teniendo en cuenta que el tipo de información del conjunto de datos sea consecuente con la periodicidad definida por la entidad. ','Verificar que la frecuencia de actualización señalada en la metadata debe responder al contenido de la información del conjunto de datos. En el caso de presentarsen conjuntos de datos de años anteriores, se debe evidenciar que la infomación esté al día según la frecuencia de actualización definida.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf NTC 4611 ','',1),(5,6,1,'El conjunto de datos se encuentra documentado a través de metadatos.','La metadata del conjunto de datos debe contener como mínimo los siguientes atributos: Título de Conjunto de Datos Breve Descripción Tipo de Licencia Nombre de la Entidad Autor Departamento Municipio Orden Sector Idioma Frecuencia de Actualización Fecha Emisión','Verificar que la metadata del conjunto de datos cumpla con los atributos mínimos mencionados en el criterio de evaluación.','NTC 4611','Los metadatos son datos que describen los aspectos básicos de un conjunto de datos y son una herramienta fundamental para organizar, clasificar, relacionar y encontrar los datos necesarios. La cantidad y calidad de metadatos asociados a un conjunto de datos, permite una mejor clasificación y una mejor búsqueda y recuperación de los datos.  La metadata del conjunto de datos publicada en www.datos.gov.co lo encuentra en el conjunto de datos con el nombre \"acerca de\".',1),(6,3,2,'La entidad analiza e identifica la vinculación de sus datos con otro(s) conjunto(s) de datos.','Análisis e identificación de vinculación del conjuntos de datos con otros.','Documento u otra información donde demuestre que se anallizó e identificó la necesidad de conectar su conjunto de datos con el de otra fuente de información.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(7,6,2,'El conjunto de datos geográfico cumple con los criterios de calidad de la información de acuerdo a los estándares nacionales e internacionales.','El conjunto de datos contiene columnas de georeferenciación (latitud y longitud) que permiten generar un mapa a partir de la informacion publicada.','Verificar que el conjunto de datos cumple con las características definidas para la calidad de la información geográfica:  Nivel de veracidad de los elementos (capturados) Grado de certidumbre  Cercanía en posición de los objetos  Grado de realidad en la escala del tiempo Grado de fidelidad de los valores de los atributos.  En caso tal de que el conjunto de datos geográfico se encuentre publicado en el portal de datos abiertos del Estado Colombiano, se da por sentado el cumplimiento de las características en mención.','NTC 5043 NTC 5660 Estándares OGC (Open GeoSPatial Consortium)  RESOLUCIÓN 068 de 2005 Por la cual se adopta como único datum oficial de Colombia el Marco Geocéntrico Nacional de Referencia: MAGNA-SIRGAS. Lineamientos, normas y guías establecidas por la Infraestructura Colombiana de Datos Espaciales-ICDE','Las siguientes son las características de calidad de un conjunto de datos geográfico:  1. Nivel de veracidad de los elementos (capturados), sus atributos y sus relaciones respecto a la especificación técnica del producto. 2. Grado de certidumbre con el cual el conjunto de datos cumple con las especificaciones del producto, en lo que respecta a la estructura interna de los datos, reglas topológicas, atributos y relaciones. 3. Cercanía en posición de los objetos en el conjunto de datos, con respecto a su posición verdadera (o la asumida como verdadera).  4. Grado de realidad en la escala del tiempo, de los elementos existentes en la base de datos y sus relaciones temporales con respecto a las especificaciones del producto. 5. Grado de fidelidad de los valores de los atributos asignados a los elementos en la base de datos con respecto a su verdadera característica en el mundo real y la clasificación correcta de los objetos y sus relaciones de acuerdo con las especificaciones de producto.  En caso tal de que el conjunto de datos geográfico se encuentre publicado en el portal de datos abiertos del Estado Colombiano, se da por sentado el cumplimiento de las características en mención.  El conjunto de datos geográfico debe adoptar el Marco Geocéntrico Nacional de Referencia: MAGNA-SIRGAS según lo establecido por el Instituto Geográfico Agustín Codazzi. En el siguiente enlace web podrá encontrar toda la documentación relacionada http://www2.igac.gov.co:8080/igac_web/UserFiles/File/MAGNAWEB_final/DocumentosMAGNA.htm  Los lineamientos, normas y guías establecidas por la ICDE las podrá encontrar en http://www.icde.org.co/ ',1),(8,6,1,'El conjunto de datos se encuentra publicado en el portal de datos abiertos del Estado Colombiano o la herramienta que haga sus veces. En caso de estar publicado en portales o sistema de información propios de la entidad, deberá garantizar que los datos estén debidamente enlazados o federados al portal de datos abiertos del Estado Colombiano.','Conjunto de datos publicado en el portal de datos abiertos del Estado Colombiano, conjunto de datos externo enlazado al portal de datos abiertos del Estado Colombiano o portal de datos propio de la entidad federado al portal de datos abiertos del Estado Colombiano.','Verificar que el conjunto de datos se encuentre publicado en el portal de datos abiertos del Estado Colombiano en www.datos.gov.co En caso de que el conjunto de datos esté publicado en portales o sistemas de información propios de la entidad, este deberá enlazarse o federarse al portal de datos abiertos del Estado Colombiano y deberá garantizar de igual manera el cumplimiento de todos los requisitos establecidos para el Sello.','Ley 1712 de 2014, artículo 11, numeral j Decreto 103 de 2015, artículo 11 Marco de referencia TI. Apertura de datos - LI.SIS.08 Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','Base de datos Federados: Son vistas unificadas de bases de datos independientes que aparentan ser una sola base de datos, pero son una colección de sistemas de bases de datos independientes, cooperativos, heterogéneos, que son autónomos y que permiten compartir todos o algunos de sus datos. Una BDF aparenta ser una BD normal y corriente, pero no tiene existencia física, es una vista lógica.   Actualmente el portal de datos abiertos del Estado Colombiano permite embeber portales de datos externos o de otras entidades, con el fin de unificar, agregar o consolidar el conjunto de datos. Se deben verificar las condiciones técnicas para la federación del conjunto de datos a través de un acompañamiento que brinda el MinTIC.',1),(9,4,1,'El conjunto de datos está disponible para cualquier usuario de forma libre y sin restricciones.','El conjunto de datos se encuentra asociado a una licencia abierta. ','Verificar que el conjunto de datos este relacionado a una licencia abierta que permita el uso, transformación, distribución, redistribución, reutilización, compilación, extracción, copia, difusión, modificación y/o adaptación de los datos y de la información publicada.  Verificar que la licencia esté publicada en el portal o en el sistema de información que la entidad disponga para la publicación de sus datos. Se recomienda publicar licencias creative commons attribution 4.0','Ley 1712 de 2014 art. 6  Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf Anexo 1. Uso de licencias abiertas','Puede ver los tipos de licencia abierta creative commons en el portal de Open Definition: http://opendefinition.org/licenses/ ',1),(10,2,1,'El usuario puede acceder al conjunto de datos de manera gratuita. ','Acceso gratuito al conjunto de datos','El conjunto de datos podrá ser consultado y descargado de manera gratuita.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(11,2,1,'El usuario puede acceder al conjunto de datos sin ninguna restricción técnica o legal.','Restricción técnica o legal para acceder al conjunto de datos.','Verificar que los datos no contengan restricciones de acceso, por ejemplo diligenciar algún tipo de registro o cualquier tipo de permiso especial para su obtención.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(12,6,1,'El usuario puede descargar el conjunto de datos en formatos libres.','Descarga del conjunto de datos en formatos libre.','Verificar que el conjunto de datos pueda descargarse en cualquiera de los siguientes formatos libres dependiendo de las características del dato: CSV, XML, JSON, RDF, RSS, entre otros. ','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','Formatos libres: Son formatos de archivo que se pueden crear y manipular para cualquier software, libre de restricciones legales y que aumentan el nivel de reutilización de los datos.',1),(13,6,3,'La entidad cuenta con mecanismos de publicación automática de los datos (ETL-proceso de extracción, transformación y carga o scripts) desde sus fuentes principales de información.','Deben existir mecanismos de publicación automáticos de los datos para extraerlos, transformarlos y cargarlos desde sus fuentes principales.','La entidad debe generar evidencia de la ejecución de la ETL, por ejemplo capturas de pantalla de los logs del servidor.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(14,6,3,'En caso que aplique, el conjunto de datos se encuentra vinculado o enlazado con otro(s) conjunto(s) de datos.','Vinculación del conjunto de datos con otros.','La entidad debe generar evidencia de que el conjunto de datos se encuentra enlazado o vinculado con otro (s) conjunto (s) de datos a través de estándares web tipo HTTP, RDF y URI o cualquier otro requerido.','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','Los datos enlazados o vinculados son una manera normalizada de representar datos sobre una gran variedad de temas. La publicación de datos vinculados facilita a los programadores la conexión de información de diferentes fuentes, lo que lleva a nuevas e innovadoras aplicaciones.',1),(15,6,2,'La entidad habilita mecanismos de acceso a los datos por medio de interfaces de programación de aplicaciones APIs, permitiendo que terceros busquen automáticamente, recuperen o consuman los datos directamente del portal de datos abiertos. ','Habilitar interfaces de programación APIs para que terceros puedan consumir información del conjunto de datos.','Evidencia a la instrucción o regla donde se encuentre habilitada la API.   En caso de que los datos se encuentren publicados en datos.gov.co, podrá encontrar la documentación y los parámetros de acceso a la API en la sección exportar.  ','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','Una API (Application Programming Interface o Interfase de Programación de Aplicaciones) es un conjunto de funciones que facilitan el intercambio de mensajes o datos entre dos aplicaciones.',1),(16,5,1,'La entidad genera mecanismos para que los usuarios del conjunto de datos reporten hallazgos, comentarios o sugerencias.','Habilitar mecanismos digitales para que los usuarios reporten hallazgos, comentarios o sugerencias de los datos publicados. ','Evidencia en donde demuestre que la entidad habilitó uno o varios mecanismos digitales para que los usuarios del conjunto de datos reporten hallazgos, comentarios o sugerencias. Por ejemplo: correos electrónicos, chats, foros, entre otros.  ','Guía para la apertura de datos abiertos en Colombia: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','En caso de que los datos se encuentren publicados en datos.gov.co, el mecanismo habilitado lo podrá encontrar en la sección debatir.',1),(17,5,2,'La entidad desarrolla una estrategia que permite mejorar la calidad de los datos publicados a partir de la realimentación de sus usuarios.','Teniendo en cuenta los comentarios o sugerencias recibidas por los usuarios del conjunto de datos, la entidad deberá desarrollar e implementar una estrategia que permita mejorar la calidad del mismo.','Documento con la estrategia de mejoramiento de la calidad de los datos, en donde se evidencie que se está teniendo en cuenta los comentarios o sugerencias recibidas de los usuarios.','Guía para la apertura de datos abiertos en Colombia, pág, 31 y 32: http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(18,3,2,'La entidad evalúa el uso de los datos publicados y la satisfaccion de sus usuarios.','Evaluación de uso y satisfacción de los usuarios del conjunto de datos. Para monitorear el uso de los datos abiertos, es posible utilizar algunos indicadores de tipo cuantitativo que permiten determinar su demanda y nivel de uso. Algunos de estos pueden ser: • Número de descargas del conjunto de datos. • Número de aplicaciones generadas a partir del conjunto de datos y la entidad haya logrado identificar. • Número de publicaciones que hicieron uso del conjunto de datos (papers, artículos, noticias, libros, etc.) y que la entidad haya logrado identificar.  En cuanto a la satisfacción de usuarios se puede medir a través de encuestas en línea u otra herramienta que facilite la satisfacción de la información contenida en el conjunto de datos.','Documento que evidencie los resultados de la evaluación del uso de los datos y de la satisfacción de sus usuarios.','Guía para la apertura de datos abiertos en Colombia, pág 31 http://estrategia.gobiernoenlinea.gov.co/623/articles-8248_Guia_Apertura_Datos.pdf','',1),(32,9,1,'La entidad debe identificar las problemáticas que pueden ser solucionadas a través del ejercicio de participación','Ejercicios que evidencien el diagnóstico de identificación de problemáticas claras basadas en un metodología adoptada por la entidad','Documento diagnóstico que evidencie el ejercicio de identificación de problemáticas realizado por la entidad','Ley 1437 de 2011 art. 3 num 6). Ley 1757 de 2015 Art. 110 - Ley 152 de 1995 - Ley 1474 de 2011 Art. 78. Manual de Gobierno en Línea.','La entidad podrá hacer uso de algún ejercicio que incluya la participación ciudadana para identificar las problemáticas como resultado del ejercicio. En cuanto a metodología la entidad podría utilizar ejercicios de ideación y colaboración con ciudadanía o grupos de interés. Ver guia de innovación abierta  ',1),(33,9,1,'La entidad debe definir la estrategia de participación','Incluir en la estrategia de participación los siguientes criterios: procedimiento de participación con el tiempo de duración del ejercicio, objetivos y temática del ejercicio de participación, escenarios de participación, herramientas y/o canales de comunicación para difundir la información, resultados esperados, definición de métricas e indicadores cualitativos y cuantitativos, definición de recursos a destinar, plan de promoción y divulgación, sinergias entre entidades ','Documento en donde se encuentre definida la estrategia de participación ','Ley 1437 de 2011 art. 3 num 6). Ley 1437 de 2011. art. 8. Ley 134 de 1994. Ley 1757 de 2015 Art. 110. Manual de Gobierno en Línea.','',1),(34,9,1,'La entidad debe caracterizar los actores y seleccionar las herramientas y/o canales de comunicación que serán parte del ejercicio de participación ','Identificar el público objetivo interesado para hacer parte del ejercicio de participación, los intereses de los participantes, mecanismos electrónicos de participación u otras variables que agreguen valor al ejercicio para la entidad','Documento de caracterización de ciudadanos o grupos de interés objetivo del ejercicio de participación','Ley 1757 de 2015. Guia de Caracterización de Ciudadanos','Guía de caracterización de ciudadanos, usuarios y grupos de interés del DNP https://colaboracion.dnp.gov.co/CDT/Programa%20Nacional%20del%20Servicio%20al%20Ciudadano/Guia%20de%20Caracterizaci%C3%B3n%20de%20Ciudadanos.pdf',1),(35,9,2,'La entidad debe conformar un comité, equipo de trabajo u otra instancia estratégica para planear, desarrollar, y evaluar el ejercicio de participación','Conformar un equipo de trabajo que defina, ejecute y evalúe todo el proceso del ejercicio de participación','Actas de reuniones del equipo de trabajo que evidencien las estrategias y acciones que se están llevando a cabo','Ley 1437 de 2011 art. 3 num 6). Ley 1757 de 2015.','',1),(36,10,1,'La Entidad garantiza la protección de los datos personales de los usuarios participantes en el ejercicio de participación','La entidad debe contar con una politica de tratamiento de informacion y solicitar autorización para el tratamiento de datos personales al usuario participante en el ejercicio de participación','Link habilitado al mecanismo de participación ciudadana en donde se encuentre publicada la política de protección de datos','Ley 1581 de 2012. Ley 1757 de 2015.','',1),(37,8,1,'La entidad habilita un mecanismo digital de participación','Habilitar un canal por medios digitales para realizar el ejercicio de participación','Link al canal en donde se llevó a cabo el ejercicio de participación','Ley 1712 de 2015. Art. 11. Lit h)','Mecanismos digitales de participación: sitios web (plataforma web institucional, plataforma exclusiva de participación o plataforma de terceros como por ejemplo urna de cristal), videoconferencia, streaming, foros virtuales, chat, mensaje de texto, correo electrónico, entre otros',1),(38,8,2,'La entidad habilita más de un mecanismo digital de participación','Habilitar más de un canal por medios digitales para realizar el ejercicio de participación','Archivo consolidado relacionando los links de los canales habilitados, en donde se realizó el ejercicio de participación','Ley 1712 de 2015. Art. 11. Lit. h)','Mecanismos digitales de participación: sitios web (plataforma web institucional, plataforma exclusiva de participación o plataforma de terceros como por ejemplo urna de cristal), videoconferencia, streaming, foros virtuales, chat, mensaje de texto, correo electrónico, entre otros',1),(39,12,3,'El usuario podrá acceder al mecanismo de participación digital a través de dispositivos móviles aplicando tecnologías de diseño web adaptativo (Responsive Web Design-RWD)','El usuario podrá acceder y desplazarse fácilmente por los contenidos del mecanismo de participación a través de dispositivos móviles como celulares y tabletas','El evaluador deberá acceder al mecanismo de participación por dispositivos móviles (celular, tableta), a fin de validar que pueda navegar fácilmente por los contenidos.','Manual de Gobierno en Línea, Marco de Referencia de Arquitectura TI','',1),(40,11,1,'El mecanismo digital de participación deberá estar disponible en todo momento. En caso de no estarlo, el usuario debe ser informado de la causa y del tiempo estimado de restablecimiento del servicio.','En caso que el mecanismo digital de participación no se encuentre disponible, se debe informar al usuario la causa y el tiempo estimado para acceder al mismo.','Captura de pantalla de los mensajes de indisponibilidad del servicio, en el cual se indiquen las causas y el tiempo estimado de restablecimiento.','Manual de Gobierno en Línea, Marco de Referencia de Arquitectura TI','',1),(41,7,1,'La entidad debe promocionar y divulgar la estrategia del ejercicio de participación','Desarrollar el plan de promoción y divulgación definido en la estrategia de participación, en el cual podrán utitlizar redes sociales, páginas institucionales, entre otros.','Documento en donde se evidencien las actividades desarrolladas para promocionar y divulgar la estrategia de participación y documento con la estrategia de participación.   El documento de promoción y divulgación deberá guardar coherencia con el de la estrategia de participación.','Ley 1757 de 2015 Art. 110 - Ley 152 de 1995 - Ley 1474 de 2011 Art. 78. Manual de Gobierno en Línea.','',1),(42,7,1,'La entidad debe convocar por medios electrónicos a los grupos de interés o ciudadanos caracterizados ','Convocar por medios electrónicos a los grupos de interés o ciudadanos caracterizados ','Archivo consolidando la convocatoria enviada a los grupos de interés o ciudadanos identificados en la caracterización, que sea coherente con el documento de caracterización y el plan de promoción y divulgación.','Ley 1712 de 2015. Decreto 1081 de 2015. Resolución 3564 de 2015','',1),(43,9,1,'La entidad debe desarrollar el ejercicio de participación','Desarrollar las acciones definidas en el documento de la estrategia de participación ','Informe que permita evidenciar las acciones desarrolladas durante el ejercicio de participación, coherente con el documento de la estrategia de participación ','Ley 1757 de 2015 Art. 110 - Ley 152 de 1995 - Ley 1474 de 2011 Art. 78. Manual de Gobierno en Línea.','Tenga en cuenta que este requisito solo evaluará los criterios enmarcadas en la etapa de ejecución definida en la estrategia de participación ',1),(44,11,1,'La entidad debe responder las preguntas o comentarios de los ciudadanos o grupos de interés durante el ejercicio de participación','Hacer seguimiento y responder a las diferentes consultas realizadas durante el ejercicio por los diferentes canales habilitados ','Archivo consolidando las respuestas a los ciudadanos o grupos de interés durante el ejercicio de participación','Ley 1437 de 2011. Ley 1757 de 2015','',1),(45,9,1,'La entidad debe dar cierre y analizar el (los) resultado (s) del ejercicio de participación','Recolección y análisis de comentarios sobre el ejercicio de participación: número de participantes, tipo de participantes, número de propuestas, número de personas que consultaron la información u otras que considere la entidad','Documento consolidando el análisis de comentarios sobre el ejercicio de participación: número de participantes, tipo de participantes, número de propuestas, número de personas que consultaron la información u otras que considere la entidad','Ley 1757 de 2015','',1),(46,7,1,'La entidad debe publicar y divulgar los resultados del ejercicio de participación','Publicar los resultados en el portal web de la entidad, y en los casos que aplique, en el portal propio o de terceros en donde se haya realizado el ejercicio de participación.  Divulgar por los diferentes canales que disponga la entidad, los resultados generados en el ejercicio de participación','Link al portal web en donde se haya realizado la publicación del ejercicio de participación y archivo consolidado con los pantallazos o links, en donde se divulgaron los resultados del ejercicio de participación','Ley 1712 de 2015. Decreto 1081 de 2015. Resolución 3564 de 2015','',1),(47,9,2,'La entidad deberá involucrar y comprometer a los ciudadanos, usuarios o grupos de interés para trabajar de manera colaborativa en el planteamiento de soluciones ','La entidad deberá realizar un trabajo conjunto con los diferentes actores caracterizados e involucrados en el ejercicio de participación, con el propósito de desarrollar soluciones de manera colaborativa a los retos o problemáticas propuestas','Documento donde se detallen los resultados obtenidos en el ejercicio de colaboración con los ciudadanos, usuarios y grupos de interés para la generación de soluciones e ideas a retos o problemáticas propuestas. ','Ley 1437 de 2011 art. 3 num 6). Ley 1757 de 2015. Manual de Gobierno en Línea.','',1),(48,9,3,'La entidad deberá desarrollar soluciones en colaboración con los ciudadanos, usuarios o grupos de interés','La entidad deberá desarrollar un trabajo coordinado con los diferentes actores para resolver soluciones','Documento donde se describan las soluciones desarrolladas y los sectores participantes en la misma.','Ley 1437 de 2011 art. 3 num 6). Ley 1757 de 2015. Manual de Gobierno en Línea.','',1),(49,9,2,'La entidad debe evaluar la calidad del ejercicio de participación','Analizar la calidad del ejercicio de participación por medio de los siguientes criterios:  Métricas e indicadores definidos en el documento de estrategia de participación Resultados esperados Escenarios de participación Herramientas y/o canales de comunicación  Cumplimiento de los objetivos Fortalezas y debilidades del ejercicio de participación','Documento que contenga un análisis de la calidad del ejercicio de participación. Para tal fin, el documento debe evidenciar un análisis de los siguientes criterios:  Métricas e indicadores definidos en el documento de estrategia de participación Resultados esperados Escenarios de participación Herramientas y/o canales de comunicación  Cumplimiento de los objetivos Fortalezas y debilidades del ejercicio de participación','Ley 1757 de 2015. Manual de Gobierno en Línea.','',1),(50,9,2,'La entidad debe realizar un plan de mejora del ejercicio de participación ','Identificar lecciones aprendidas y acciones de mejora del ejercicio de participación.','Plan de mejora que indique las lecciones aprendidas y las acciones de mejora para futuros ejercicios','Ley 1757 de 2015. Manual de Gobierno en Línea.','',1),(51,11,3,'La entidad debe generar mecanismos de control social ','Fomentar o promover espacios digitales en el que los ciudadanos, usuarios o grupos de interés, puedan hacer seguimiento y control a las soluciones desarrolladas producto del ejercicio de participación','Evidencia en donde demuestre que la entidad habilitó uno o varios mecanismos digitales para que los ciudadanos, usuarios o grupos de interés puedan hacer seguimiento a la solución desarrollada. Por ejemplo: correos electrónicos, chats, foros, entre otros.','Ley 1437 de 2011 art. 3 num 6). Ley 1757 de 2015. Manual de Gobierno en Línea. Ley 1474 de 2011. Estatuto anticorrupción','',1),(63,15,1,'1. La Entidad cumple con las obligaciones y requisitos legales exigidos por el Estado Colombiano para el trámite o servicio en linea.','El trámite o servicio en línea (procedimiento administrativo) está publicado y actualizado en la última versión del SUIT o el sistema que haga sus veces.','Link habilitado del trámite o procedimiento administrativo (servicio) registrado en el Sistema Único de Información de Trámites-SUIT.',' Art. 40 Decreto 019 de 2012','',1),(64,15,1,'2. La Entidad informa al usuario sobre sus derechos, obligaciones y las condiciones de uso del trámite o servicio en línea.','Los términos y condiciones de uso del trámite o servicio en linea deben estar publicados para consulta del usuario.','Link habilitado a los términos y condiciones de uso del trámite o servicio en línea, en el cual se incluyan los derechos y las obligaciones del usuario e indicar el costo en caso que aplique.','Ley 1712 de 2014, y Resolución 3564 de 2015 numeral 9.1 anexo 1 Ley 1437 de 2011','',1),(65,15,1,'3. La Entidad garantiza la protección de los datos personales de los usuarios del trámite o servicio en línea.','La entidad debe contar con una politica de tratamiento de informacion y solicitar autorización para el tratamiento de datos personales al usuario del trámite o servicio en línea.','Link habilitado a la política de tratamiento de la información, en la cual se incluya la solicitud de autorización del usuario para el trato de sus datos personales. ','Ley 1581 de 2012 Decreto 1377 de 2013, art 13 Decreto 886 de 2014','En caso de que no sea posible poner a disposición del titular las políticas de tratamiento de la información, los responsables deberán informar al titular por medio de un aviso de privacidad, la existencia de tales políticas y la forma conocerlas de manera oportuna y en todo caso, a más tardar al momento de la recolección de los datos personales.  Para la difusión del aviso de privacidad y de la política de tratamiento de la información, el responsable podrá valerse de documentos, formatos electrónicos, medios verbales o cualquier otra tecnología, siempre y cuando garantice y cumpla con el deber de informar al titular.',1),(66,14,1,'4. La entidad caracteriza a los usuarios del trámite o servicio en línea ','La entidad debe identificar e implementar una estrategia de mejoramiento en la prestación del trámite o servicio en línea basado en la caracterización de usuarios.  ','Documento de caracterización de ciudadanos, usuarios o grupos de interés en donde se identifiquen las características, necesidades, intereses, expectativas y preferencias de la población objetivo a la cual está dirigido el trámite o servicio en línea.  Adicionalmente, la entidad debe demostrar que a partir del ejercicio de caracterización se planteó una estrategia para mejorar la prestación del trámite o servicio en línea. Por ejemplo: documento que especifique el diseño o adecuación del trámite o servicio en línea, estrategia de mejora de los canales de atención, estrategia de comunicaciones e información para la ciudadanía, entre otros.','Guía para la caracterización de usuarios, ciudadanos y grupos de interés - Departamento Nacional de Planeación PNSC. https://colaboracion.dnp.gov.co/CDT/Programa%20Nacional%20del%20Servicio%20al%20Ciudadano/Guia%20de%20Caracterizaci%c3%b3n%20de%20Ciudadanos.pdf  Lineamientos y metodologías en Usabilidad para Gobierno en línea, pág 116-  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','',1),(67,17,2,'1. El trámite o servicio en línea cumple con los estándares de accesibilidad web en nivel de conformidad A. ','No deben presentarse errores al realizar la validación automática de los criterios de accesibilidad web en nivel A aplicables al trámite o servicio en línea. ','El evaluador deberá garantizar a través de un análisis de accesibilidad web, que el trámite o servicio en línea no presenta problemas o errores de validación automática en los criterios de accesibilidad aplicables en nivel A en todas las secciones del trámite o servicio en línea.   Cabe resaltar, que la entidad deberá garantizar el cumplimiento en el nivel A de los criterios de accesibilidad web aplicables al trámite o servicio en línea, para lo cual no será necesario adjuntar ninguna evidencia por ser el evaluador quien realice el debido diagnósitico.','NTC5854 (Norma Técnica Colombiana de accesibilidad web) Estándares de la W3C (World Wide Web Consortium) WCAG 2.0','Se recomienda utilizar los siguientes validadores automáticos: http://www.tawdis.net/, http://examinator.ws/, https://achecker.ca/checker/index.php o cualquier otro que valide según la guía WCAG 2.0 de la W3C analizando todo el procedimiento del trámite o servicio en línea.  NOTA. SOLO APLICAN LOS CRITERIOS DE ACCESIBILIDAD ACORDES AL DESARROLLO DEL TRAMITE O SERVICIO.  El servicio que se presta por app, se evalúa activando en la configuración del móvil la opción de accesibilidad y navegando por las múltiples opciones del servicio. Además, la entidad debe garantizar el cumplimiento permanente de los requisitos ante cualquier cambio o actualización de contenidos.',1),(68,17,2,'2. El código en el que está hecho el trámite o servicio en línea cumple los estándares internacionales de programación web.','El código fuente del trámite o servicio en línea no presenta errores de programación','El evaluador deberá garantizar a través de un análisis de validación de código, que el trámite o servicio en línea no presenta problemas o errores aplicables en todas las secciones del trámite o servicio en línea.   Cabe resaltar, que la entidad deberá garantizar el cumplimiento de los criterios de validación del código aplicable al trámite o servicio en línea, para lo cual no será necesario adjuntar ninguna evidencia por ser el evaluador quien realice el debido diagnósitico.','Estándares de la W3C (World Wide Web Consortium)','Se recomienda utilizar el siguiente validador automático: https://validator.w3.org/ o cualquier otro que valide según la guía WCAG 2.0 de la W3C analizando todo el procedimiento del trámite o servicio en linea.  Para el caso de aplicaciones móviles, tenga en cuenta que si el app se publica en alguna tienda de aplicaciones, se da por cumplidos los estándares de calidad del código',1),(69,17,2,'3. El formulario del trámite o servicio en línea usa el estandar del lenguaje común de intercambio de información. ','Los campos del formulario del trámite o servicio en linea están incluidos en el diccionario del lenguaje común del Estado Colombiano.','Documento que demuestre que los campos del formulario del trámite o servicio en línea se encuentran certificados con el diccionario del lenguaje común del Estado Colombiano.','Guia de uso del lenguaje común de intercambio de información  http://estrategia.gobiernoenlinea.gov.co/623/articles-8240_Guia_Lenguaje.pdf','Para solicitar la inclusión de nuevos campos en el diccionario del lenguaje común deberá seguir el procedimiento establecido en el siguiente enlace web: http://estrategia.gobiernoenlinea.gov.co/623/articles-8240_Guia_Lenguaje.pdf',1),(70,17,3,'El trámite o servicio en línea de la entidad dispone de interfaces de programación de aplicaciones - APIS.','API disponible para facilitar la integración del trámite o servicio con el de otras entidades o para permitir el acceso al trámite o servicio en linea a través de otras fuentes de información.','Tutorial, manual o instrucciones de acceso al API del trámite o servicio en línea. ','Manual de Gobierno en línea, componente TIC para servicios, trámites y servicios en línea  http://estrategia.gobiernoenlinea.gov.co/623/w3-propertyvalue-8011.html  Marco de referencia arquitectura empresarial','API: interfaz de programación de aplicaciones. A continuación se presenta un ejemplo http://developers.payulatam.com/es/api/queries.html',1),(71,14,1,'5. El trámite o servicio en línea cuenta con un mecanismo de consulta o registro para la identificación del usuario.','El registro o mecanismo de identificación permite establecer la identidad de la persona que solicita el trámite o servicio en línea.','Análisis de evaluación de riesgo en donde se determine el nivel de garantía aplicable al trámite o servicio en línea. Por ejemplo, en nivel básico se podrá identificar que el trámite o servicio en linea requerirá de autenticación por usuario y contraseña; en nivel avanzado de firma electrónica.','Ley 962 de 2005 art. 6. Medios tecnológicos, parágrafo 2  Ley 1437 de 2011','  ',1),(72,13,1,'6. El usuario podrá elegir el medio de respuesta para recibir notificaciones. ','El trámite o servicio en línea debe permitir que el usuario escoja el medio por el cual será notificado.','Link habilitado a la sección del registro de usuario, en donde el evaluador pueda verificar que el trámite o servicio en línea cuenta con la opción para elegir el medio por el cual será notificado.','Leyes 1266 de 2008, 1273 de 2009, 1437 de 2011 Artículo  54, 1581 de 2012, 1755 de 2015, Decreto 1377 de 2013 y resolución 3564 de 2015 ','',1),(73,13,1,'7. El usuario podrá encontrar ayuda para ejecutar el trámite o servicio en línea.','Contar con una guía, manual o ayuda que permita al usuario diligenciar adecuadamente la información requerida para ejecutar el trámite o servicio en línea. ','Link habilitado a la guía, manual o ayuda con las instrucciones para la ejecución del trámite o servicio en línea.','Ley 1712 de 2014, Ley 1341 de 2009, Decreto 1081 de 2015, Decreto 103 de 2015, art 3, Resolución 3564 de 2015 anexo 2','',1),(74,13,1,'8. Los formularios del trámite o servicio en línea deben contar con una validación de campos que indiquen al usuario si existen errores en el diligenciamiento o información faltante. ','El formulario del trámite o servicio en línea debe contar con la opción automática de verificación de los datos ingresados.','Link habilitado al formulario en donde el evaluador pueda verificar que los campos cuentan con la opción automática de validación para constatar que no existen errores en el diligenciamiento o información faltante. ','Ley 1712 de 2014, Ley 1341 de 2009, Decreto 1081 de 2015, Decreto 103 de 2015, art 3, Resolución 3564 de 2015 anexo 2','',1),(75,13,1,'9. Si el trámite o servicio en línea requiere un pago, éste debe tener la posibilidad de hacerlo en línea y por otros medios.','El usuario del trámite o servicio en línea, debe contar con la posibilidad de efectuar el pago a través de alguno de los siguientes mecanismos:   *Pasarelas de pago (PSE, pago con tarjetas débito, pago con tarjetas de crédito, transferencia de fondos a cuenta de ahorro/corriente) * Terminal punto de venta (baloto, gana gana, etc.) * Operadores postales de pago (giros nacionales e internacionales) * Redeban multicolor * Transferencia bancaria * Corresponsal bancario   En todo caso, el trámite o servicio en línea debe tener la opción de generar un recibo para realizar el pago presencialmente.','Link habilitado al mecanismo de pago en línea en donde el evaluador pueda verificar que el trámite o servicio en linea cuenta con esta opción. Así mismo, pueda verificar que existe para descarga el recibo para pagos presenciales.','Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/arquitecturati/630/w3-channel.html','',1),(76,13,1,'10. El usuario podrá diligenciar el trámite o servicio en línea a través de cualquier navegador web.','El usuario puede ejecutar el trámite o servicio en línea, a través de cualquier navegador web y en cualquier versión disponible.','El evaluador deberá acceder al trámite o servicio en línea por distintos navegadores web y versiones, para verificar que el contenido cargue completamente y permita su ejecución.','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, la cual puede descargar en:  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','',1),(77,13,1,'11. Durante la ejecución del trámite o servicio en línea, el usuario podrá corregir la información registrada y la documentación de soporte que haya cargado.','El usuario podrá corregir la información registrada y modificar los soportes cargados antes de finalizar la solicitud.','El evaluador deberá navegar por las secciones del trámite o servicio en línea en donde se registre información y pueda verificar que es posible corregirla. Del mismo modo, debe verificar que la documentación de soporte puede ser corregida antes de finalizar con la solicitud.','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, la cual puede descargar en:  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','',1),(78,13,2,'4. El usuario es alertado por inactividad prolongada durante la ejecución del trámite o servicio en línea. Si el usuario no confirma actividad en un lapso de tiempo, el sistema cerrará la sesión automáticamente.','El trámite o servicio en línea debe contar con la opción de alertar al usuario por inactividad y confirmar el cierre de sesión automática en caso de no recibir confirmación. ','El evaluador deberá verificar en el trámite o servicio en línea que el usuario es alertado por inactividad prolongada durante la ejecución del trámite o servicio en línea y en caso de no confirmar, el sistema deberá cerrar la sesión automáticamente. ','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, la cual puede descargar en:  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','',1),(79,13,2,'5. El usuario podrá continuar ejecutando el trámite o servicio en línea a través de sesiones parciales guardadas en el sistema. ','El trámite o servicio en línea debe contar con la trazabilidad de las sesiones guardadas durante su ejecución.','El evaluador deberá verificar en el trámite o servicio en línea que el usuario podrá continuar ejecutando el trámite o servicio en línea a través de sesiones parciales guardadas en el sistema.','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, que se puede descargar en: http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf ','',1),(80,13,1,'12. Cuando el trámite o servicio en línea requiere anexos en formato digital, se debe indicar al usuario las caracteristicas de dichos anexos.','El trámite o servicio en línea deberá especificar el tipo de formato, tamaño permitido y otras caracteristicas que deban tener los anexos.','Link habiltado a la sección del trámite o servicio en linea en donde se encuentren especificadas las caracterísiticas de los documentos anexos.','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, la cual puede descargar en:  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','',1),(81,15,1,'13. El trámite o servicio en línea debe contar con un servicio de atención, en donde se especifique la información general del trámite e informar los medios para hacer seguimiento.','El servicio de atención del trámite o servicio en línea debe proporcionar información como horario, datos de contacto, tiempo estimado de respuesta del trámite, canales de comunciación y medios para hacer seguimiento, entre otros.','Link habilitado al servicio de atención al usuario, en donde se especifique los datos de contacto, tiempo estimado de respuesta del trámite, medios para hacer seguimiento, horarios de atención y tiempo de respuesta.','Ley 1437 de 2011 Artículo 7, numeral 8. Deberes de las autoridades en la atención al público. ','',1),(82,13,1,'14. El trámite o servicio en línea estará disponible en todo momento. En caso de no estarlo, el usuario debe ser informado de la causa y del tiempo estimado de restablecimiento del servicio.','En caso que el trámite o servicio en línea no se encuentre disponible, se debe informar al usuario la causa y el tiempo estimado para acceder al mismo.','Captura de pantalla de los mensajes de indisponibilidad del servicio, en el cual se indiquen las causas y el tiempo estimado de restablecimiento.','Resolución 3564 de 2015, anexo 2. Numeral 1.9  Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/arquitecturati/630/w3-channel.html','La disponibilidad mide el grado con el que los recursos del sistema están disponibles para su uso por el usuario final a lo largo de un tiempo dado. Esta no sólo se relaciona con la prevención de caídas del sistema (también llamadas tiempos fuera de línea, downtime u offline), sino incluso con la percepción de \"caída\" desde el punto de vista del usuario: cualquier circunstancia que nos impida trabajar productivamente con el sistema es considerada como un factor de baja disponibilidad. La disponibilidad se establece a través de los acuerdos de nivel del servicio, que definen cuánto tiempo y en qué horarios debe estar en línea. ',1),(83,15,3,'No se podrá exigir al usuario del trámite o servicio, actos administrativos, constancias, certificaciones o documentos que ya reposen en la entidad ante la cual se está tramitando la respectiva actuación o que se encuentren en otra entidad pública.','Actos administrativos, constancias, certificaciones o documentos que ya reposen en la entidad o que se encuentren en otra entidad pública.','Documento que contenga el listado de actos administrativos, constancias, certificaciones o documentos que reposen en la entidad. Además, documento o documentos que contengan el listado de los actos administrativos, constancias, certificaciones o documentos que sean requeridos por parte de la entidad para la realización del trámite o servicio. El evaluador debe  comparar estos dos documentos y no deben solicitarse aquellos que ya reposan en la entidad para la realización del trámite o servicio en línea.','Art 9 Decreto Ley 019 de 2012','',1),(84,17,2,'6. El usuario podrá acceder al trámite o servicio en línea a través de dispositivos móviles aplicando tecnologías de diseño web adaptativo (Responsive Web Design-RWD).','El usuario podrá acceder y desplazarse fácilmente por los contenidos del trámite o servicio en línea a través de dispositivos móviles como celulares y tabletas.','El evaluador deberá acceder al trámite o servicio en línea por dispositivos móviles (celular, tableta), a fin de validar que se pueda navegar fácilmente por los contenidos. ','Se ajusta a los lineamientos y metodologías en usabilidad web para Gobierno en línea, la cual puede descargar en:  http://estrategia.gobiernoenlinea.gov.co/623/articles-8237_guia_usabilidad.pdf','El evaluador podrá validar el diseño web adaptativo del trámite o servicio en linea, ingresando a la siguiente herramienta:  http://www.responsinator.com/',1),(85,17,3,'El trámite o servicio en línea se encuentra disponible para el intercambio de información con otras entidades.','El trámite o servicio en línea debe cumplir con las siguientes características de intercambio de información: -Estandarizado según en lenguaje común definido en el marco de interoperabilidad. -Disponible para consulta con otras entidades.','Documento que demuestre que el trámite o servicio en línea se encuentra certificado en el directorio de servicios de intercambio de información del Estado.','Art 9 Decreto Ley 019 de 2012 Guía del uso del marco de interoperabilidad  http://estrategia.gobiernoenlinea.gov.co/623/articles-8240_Guia_Interoperabilidad.pdf  Guía del uso del lenguaje común de intercambio de información http://estrategia.gobiernoenlinea.gov.co/623/articles-8240_Guia_Lenguaje.pdf','',1),(86,16,1,'15. El usuario recibe un mensaje de confirmación de la solicitud del trámite o servicio en línea y tiene la posibilidad de hacer seguimiento en linea.','Al ejecutar el trámite o servicio en línea, el sistema debe generar un mensaje de confirmación de la solicitud indicando fecha, hora de recepción, número de registro de la solicitud y el plazo de respuesta. Así mismo, el trámite o servicio debe contar con un sistema de seguimiento en linea.','Registros o imágenes del mensaje de confirmación que recibe el usuario al realizar el trámite o servicio en línea. El cual deberá contener: fecha de la solicitud, hora de recepción, número de registro de la solicitud y plazo de respuesta. Así mismo, link al sistema de seguimiento del trámite o servicio en linea. ','Resolución 3564 de 2015. Anexo 2 numeral 8 Ley 1437 de 2011 Artículo 62. Prueba de recepción y envío de mensajes de datos por la autoridad  Resolución 3564 de 2015, art 1010 y Ley 1437 de 2011 art 5 numeral 4, art 14','',1),(87,16,1,'16. El usuario podrá presentar peticiones, quejas, reclamaciones o recursos relacionados con el trámite o servicio en línea.','Garantizar que a través de la plataforma o del sistema del trámite o servicio en línea, el usuario puede presentar peticiones, quejas, reclamaciones o recursos.','Link habilitado al sistema de pqr del trámite o servicio en línea. El evaluador deberá verificar que la plataforma del servicio cuente con una sección para interponer pqr o que el servicio indique y direccione al usuario al sistema de pqr de la entidad en donde pueda interponer este recurso. ','Art. 6 Ley 962 de 2005 LEY 1437 DE 2011 Artículo 7°. Deberes de las autoridades en la atención al público. Numeral 8 Resolución 3564 de 2015, anexo 2. Numeral 1.8','',1),(88,13,1,'17. El usuario recibe el producto resultado del trámite o servicio en línea.','El producto resultado del trámite o servicio en línea es entregado al usuario asegurando la autenticidad, integridad y disponibilidad de la información.','Reportes del sistema del trámite o servicio en línea que evidencien que el producto o servicio fue entregado. Adicionalmente, los reportes deben permitir evidenciar que el resultado del servicio generó un documento firmado electrónicamente o que cuenta con un sistema de información donde se pueda verificar la validez del documento.','Ley 1437 de 2011 art. 56 y 67 Guía de usuario del Sistema Único de Información de Trámites, SUIT 3  http://www.suit.gov.co/documents/10179/11887/Gu%C3%ADa+de+usuario+del+Sistema+%C3%9Anico+de+Informaci%C3%B3n+de+Tr%C3%A1mites.pdf  Código General del Proceso Ley 1564 de 2012 Art. 243. Clases de documentos. Art. 244. DOCUMENTO AUTÉNTICO.   Ley 962 de 2005 Art. 6 Parágrafo 2  Ley 1437 de 2011 art. 57. Acto administrativo electrónico  Decreto 2364 de 2012 art. 1. Definiciones Numeral 3 art. 4. Confiabilidad de la firma','Producto: Es el resultado que tiene un usuario por parte de una institución al ejecutar un trámite o servicio (procedimiento administrativo). Estos pueden ser tangibles o intangibles.  Documento: Son documentos los escritos, impresos, planos, dibujos, cuadros, mensajes de datos, fotografías, cintas cinematográficas, discos, grabaciones magnetofónicas, videograbaciones, radiografías, talones, contraseñas, cupones, etiquetas, sellos y, en general, todo objeto mueble que tenga carácter representativo o declarativo.  Firma electrónica: Métodos tales como, códigos, contraseñas, datos biométricos, o claves criptográficas privadas, que permite identificar a una persona, en relación con un mensaje de datos, siempre y cuando el mismo sea confiable y apropiado respecto de los fines para los que se utiliza la firma, atendidas todas las circunstancias del caso, así como cualquier acuerdo pertinente.  El resultado del servicio debe generar un documento que permita identificar adecuadamente el sujeto que lo emitió, así como que su contenido sea íntegro, completo e inalterado y sin interrupciones.',1),(89,17,2,'7. Cuando el producto del trámite o servicio en línea sean datos relacionados con información geográfica, la entidad debe disponer de mecanismos tecnológicos de acceso, consulta, visualización y descarga. Adicionalmente, la información debe estar documentada a través de metadatos. ','El producto del trámite o servicio en línea relacionado con información geográfica, se puede acceder, consultar, visualizar y descargar. La información geográfica debe estar documentada a través de metadatos.','Link habilitado al repositorio que permita el acceso, consulta, visualización y descarga de los datos geográficos. El evaluador debe verificar además que la información debe estar documentada a través de metadatos. En caso de que este criterio no le aplique a la entidad, debe especificar las razones.','Estándares de la OGC (Open GeoSPatial Consortium) y W3C (World Wide Web Consortium) RESOLUCIÓN 068 de 2005 Por la cual se adopta como único datum oficial de Colombia el Marco Geocéntrico Nacional de Referencia: MAGNA-SIRGAS. Lineamientos, normas y guías establecidas por la Infraestructura Colombiana de Datos Espaciales-ICDE','La entidad debe facilitar el acceso en línea a los datos geográficos y poder descargarlos en los formatos (KML, KMZ o SHAPE, CSV, GEOJSON, GML), estándares tecnológicos para la apertura de datos geográficos: WMS (web map service), WFS (web feature service) y formatos interoperables definidos por organismos como la OGC y W3C. De ser posible y para agilizar la transferencia de grandes volúmenes de información, por ejemplo imágenes de alta resolución y/o bases de datos geográficas debe disponer de mecanismos tecnológicos para su acceso como servicios FTP y/o canales de banda ancha, información en la nube, entre otros. ',1),(90,15,2,'8. Cuando el producto del trámite o servicio en línea sea un documento, éste debe estar disponible para ser consultado durante el mismo tiempo que indique la tabla de retención documental de la entidad, en los casos que aplique. ','Los documentos generados a partir de la ejecución del trámite o servicio en línea, deben estar disponibles para consulta del usuario, durante el tiempo indicado en las tablas de retención documental de la entidad.','Registro del sistema de información del trámite o servicio en línea, que evidencie el tiempo durante el cual estuvo disponible el documento para descarga por parte del usuario. Además, la entidad deberá adjuntar el archivo donde se establece el tiempo de disponibilidad del documento según las tablas de retención documental de la entidad. El evaluador debe comparar en estos dos documentos, que el tiempo establecido en las tablas de retención documental corresponda con el tiempo de disponibilidad del documento para descarga por parte del usuario. ','Ley 594 de 2000 Acuerdo 39 de 2002 Decreto 2609 de 2012, capítulo IV Artículo 23. Características del documento electrónico de archivo Artículo 28. Requisitos para la disponibilidad de los documentos electrónicos  Ley 1437 Art. 58  Acuerdo AGN 03 de 2015 - Art 13, 14, 15, 16 y 17','Son documentos los escritos, impresos, planos, dibujos, cuadros, mensajes de datos, fotografías, cintas cinematográficas, discos, grabaciones magnetofónicas, videograbaciones, radiografías, talones, contraseñas, cupones, etiquetas, sellos y, en general, todo objeto mueble que tenga carácter representativo o declarativo.   Se deben establecer mecanismos técnicos que aseguren que la información se pueda consultar y estar disponible en el futuro, independientemente del sistema que la produjo, su estructura o medio de registro original.',1),(91,14,1,'18. La entidad implementa un procedimiento para monitorear y evaluar el desempeño del trámite o servicio en línea y generar acciones de mejora.','Evaluar el desempeño del trámite o servicio en linea en términos de riesgo, eficacia y costo.','Documento con indicadores o métricas de desempeño del servicio, reportes y acciones realizadas para mejorar el servicio.','Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/arquitecturati/630/w3-channel.html','Ver en http://www.auditool.org/blog/auditoria-de-ti/1264-los-medidores-del-desempeno-en-la-seguridad-informatica',1),(92,17,1,'19. El sistema que soporta el trámite o servicio en linea contiene mecanismos que aseguran el registro histórico y trazabilidad de las acciones realizadas.','La entidad debe contar con un sistema que registra las acciones realizadas por los usuarios y por el administrador del trámite o servicio de la entidad.','Registro, imágen u otro tipo de documento que evidencie que el sistema registra las acciones realizadas por los usuarios y el administrador del trámite o servicio en línea. ','Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/arquitecturati/630/w3-channel.html','',1),(93,14,2,'9. La entidad debe contar con un plan de continuidad del trámite o servicio en línea, que establezca un proceso periodico de análisis y prevención de riesgos, gestión de emergencias y de recuperación del mismo.','Informe de gestión de disponibilidad del servicio donde se incluyan criterios de seguridad de la información, plan de continuidad del negocio (análisis de impacto del negocio), plan de respuesta de incidentes y plan de recuperación.','Verificar que la entidad disponga de un informe de gestión de disponibilidad del servicio con los criterios de seguridad de la información, plan de continuidad del negocio (análisis de impacto del negocio), plan de respuesta de incidentes y plan de recuperación.','Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/gestionti/615/w3-propertyvalue-7275.html','',1),(94,16,1,'20. La entidad mide el uso y la satisfacción del usuario frente al trámite o servicio en linea y genera acciones de mejora','La entidad realiza mediciones del uso, satisfacción del usuario e implementa acciones de mejora del trámite o servicio en línea. ','Registro, informe o documento con la medición del uso, satisfacción de los usuarios frente al trámite o servicio en linea y acciones de mejora planeadas e implementadas.','Alineado con el marco de referencia TI. Para mayor información consultar en:  http://www.mintic.gov.co/arquitecturati/630/w3-channel.html','',1),(126,18,1,'La entidad tiene la capacidad para lograr un entendimiento estratégico, de tal forma que se logre una compresión precisa, clara y documentada de la situación actual de la institución, el contexto organizacional y el entorno, para proporcionarle a la Dirección de Tecnologías de la Información una visión holística que le permita usar la tecnología como agente de transformación. ','A.      La entidad realizó un ejercicio de entendimiento estratégico que le permite establecer y entender los procesos que se desarrollan en el ámbito sectorial e institucional, y los servicios e interacciones que el sector tiene con todos los grupos de interés, con el fin de que tenga los elementos necesarios y suficientes para identificar posibles oportunidades y retos de TI que contribuyan al cumplimiento de la estrategia sectorial e institucional.\n\nB.      La entidad realizó mínimo un ejercicio de arquitectura empresarial al menos de un objetivo estratégico o proceso de negocio incorporando los lineamientos aplicables del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI del Estado colombiano.\n\nC.      La entidad tiene un Plan Estratégico de Tecnologías de la Información (PETI) o el que haga sus veces, el cual ha sido actualizado por lo menos anualmente a razón de los cambios de la estrategia de la entidad y el sector, la evolución y tendencias de las tecnologías de la información, y el estado de implementación de los proyectos de la entidad, entre otros. Identificando la situación actual u deseada de la entidad, retos y oportunidades de TI, y como va alcanzar los objeticos estratégicos de TI planteados.\n\nD.     La entidad en la definición de su estrategia de TI, tuvo en cuenta retos y oportunidades de TI, así como el análisis de las estrategias e iniciativas de TI que le permitan a la entidad alcanzar los objetivos institucionales.','Ver numeral 2.1.1 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias.',1),(127,18,1,'La entidad tiene la capacidad para direccionar estratégicamente la gestión de TI y generar valor público por medio de una Estrategia de TI alineada con el Plan Nacional de Desarrollo, los planes sectoriales e institucionales, desde el entendimiento de la misión, las metas y los objetivos de la institución. ','A.      La entidad ha definido políticas y estándares de TI alineadas con las políticas y estándares de TI establecidas para el sector y el país.\n\nB.      La entidad evidencia que el PETI es comunicado y entendido entre las diferentes partes interesadas de la entidad, por medio de un plan de comunicación.','Ver numeral 2.1.2 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(128,18,1,'La entidad tiene la capacidad para implementar y gestionar la Estrategia TI por medio del despliegue de proyectos de TI definidos en la estrategia de TI y su entrega para la operación de la institución. ','A.      La entidad evidencia la ejecución y el despliegue del portafolio de proyectos establecidos en la hoja de ruta del PETI.\n\nB.      La entidad posee y mantiene actualizado el catálogo de servicios de TI, el cual hace parte del portafolio de servicios de TI de la entidad.     ','Ver numeral 2.1.3 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(129,18,1,'La entidad tiene la capacidad de hacer el seguimiento y evaluación de la Estrategia TI, demostrando seguimiento y evaluación de la implementación y cumplimiento de entrega de valor de la Estrategia de TI a la institución.','A.      La entidad tiene implementado un tablero de control (tablero de indicadores) para el seguimiento de las fichas de inversión de los proyectos y planes de compras requeridos para llevar a cabo la implementación de la estrategia de TI.\n\nB.      La entidad realiza de manera periódica (como mínimo trimestralmente), la evaluación del cumplimiento de la Estrategia de TI, para determinar el nivel de avance y cumplimiento de los objetivos y proyectos definidos en el PETI. Este seguimiento y reporte del avance en el cumplimiento, está registrado en un tablero de control (tablero de indicadores) o equivalente.\n\nC.      La entidad ha implementado e implementa acciones de mejora continua a partir de los resultados de las evaluaciones sobre el cumplimiento de la estrategia de TI.','Ver numeral 2.1.4 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias.',1),(130,18,1,'La entidad tiene la capacidad de asegurar la definición y cumplimiento de las políticas de TI; y la alineación de su estrategia de TI está alineada con el Modelo integrado de Planeación y la Arquitecturas misional de la Entidad.','A.      La entidad posee una política de TI actualizada, aprobada y ejecutada, acorde con la estrategia y misión de la entidad. La entidad comunica y procura que las políticas de TI son entendidas por las diferentes partes interesadas de la entidad. Las políticas de seguridad y privacidad son parte de la política de TI. La política de TI debe contener como mínimo los siguientes los elementos:●       Objetivos●       Alcance●       Descripción de la política ●       Responsables●       Excepciones: Seguimiento a las excepciones, Evaluación de las excepciones, Aprobación/ desaprobación de las excepciones, documentación de las excepciones.●       Referencias a otras políticas y normas en las cuales se soporta o tiene relación.B.      La entidad cuenta con un plan de trabajo detallado (plan de acción) por cada uno de los proyectos de acuerdo con el PETI. Un plan de acción detallado debe contener como mínimo para cada proyecto: Nombre del proyecto, objetivo, alcance, plazo de ejecución (fecha de inicio y fecha final), objetivos estratégicos institucionales y de TI que apoya, responsables, dependencias y/o entidades participantes, indicadores de resultado y cronograma.C.      La entidad evidencia que los procesos de gestión de TI de la entidad, están soportados por herramientas tecnológicas que permiten una adecuada administración, seguimiento y control.D.     La entidad tiene implementada y evalúa el cumplimiento de la política de Seguridad de TI. Dicha evaluación debe incluir la valoración de la eficacia de los controles de seguridad y sostenibilidad en el tiempo. El cumplimiento de la totalidad de la política de seguridad de TI aplica para los sistemas de información desarrollados y servicios implementados posteriormente a la publicación del Marco de Referencia de Arquitectura Empresarial del Estado colombiano. Para los sistemas de información y servicios tecnológicos implementados antes de la expedición del Marco de Referencia de AE, la entidad debe poseer un plan de actualización y/o ajuste en caso de que no cumplan.E.      La entidad implementa acciones de mejora sobre la aplicabilidad y pertinencia de la política de seguridad y privacidad de la información acorde con las evaluaciones realizadas.F.      La entidad tiene definidos lineamientos e indicadores de gestión para los proyectos de TI y se encuentran registrados en un tablero de control (tablero de indicadores) o similar.  ','Ver numeral 2.2.1 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(131,18,1,'La entidad tiene la capacidad de estructurar e implementar un esquema de Gobierno de TI, para monitorear, evaluar y redirigir las TI dentro de la institución.','A.      La entidad tiene definido y documentado un proceso de gestión de TI que contemple como mínimo los subprocesos de planeación de TI, gestión de información, desarrollo y mantenimiento de sistemas de información y gestión de servicios tecnológicos, así como los demás procedimientos y actividades necesarios para gestionar los servicios de TI de la entidad.\n\nB.      La entidad tiene definido e implementado un esquema de gobierno de TI que estructure y direccione el flujo de las decisiones de TI, e incluya esquemas de relacionamiento, y toma de decisiones, definición de roles y responsabilidades, gestión de riesgos, estructura organizacional y procesos de TI, un proceso de gestión de las capacidades de TI (procesos, recursos tecnológicos y el talento humano) para ofrecer servicios de TI y garantizar la continuidad en la prestación de los servicios de TI.\n\nC.      La entidad tiene definida y aplica una metodología de evaluación de alternativas de solución y/o tendencias tecnológicas antes de iniciar un proceso de contratación e inversión en TI, que permite identificar la mejor alternativa de solución considera como mínimo criterios técnicos, funcionales y financieros con el fin de contribuir a la optimización, racionalización y sostenibilidad de las compras públicas de TI.','Ver numeral 2.1.2 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(132,18,1,'La entidad tiene la capacidad para gestionar integralmente los proyectos de TI. ','A.      La entidad hace mediciones de los indicadores de gestión de los proyectos de TI periódicamente (mínimo cada dos meses).B.      La entidad aplica y tiene definida una metodología de gestión integral de proyectos de TI, que le permite garantizar que los proyectos ejecuten su alcance en el tiempo, costo y calidad esperada.C.      La entidad tiene conformada un área de TI que hace parte del nivel directivo de la estructura organizacional de la institución y reporta directamente al representante legal o máximo líder de la entidad.D.     La entidad aplica un modelo de gestión de riesgos asociados a TI y realiza la selección y evaluación sobre la eficacia de controles aplicables (mínimo cada seis meses).','Ver numeral 2.2.3 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(133,18,1,'La entidad tiene la capacidad de gestionar la operación de TI, lo cual implica una adecuada gestión de los proveedores y la planeación, ejecución, monitoreo y mejora continua de la prestación de los servicios de TI que se brindan.','A.      La entidad ha realizado y realiza procesos de documentación y divulgación de lecciones aprendidas sobre la implementación de proyectos de TI, que le permita utilizar estas experiencias en la optimización y mejora de los procesos de selección de proveedores, contratación e implementación de proyectos de TI.B.      La entidad realizar mediciones sobre indicadores de gestión y desempeño del proceso de gestión de TI, con el objetivo de mejorar los procesos y operación de TI. Cada indicador debe tener identificados y definidas las metas de cumplimiento. Las metas deben estar alineadas a los indicadores claves de la entidad y/o sector.C.      La entidad ha implementado acciones de mejora sobre el proceso de gestión de TI acorde a los resultados de la evaluación de los indicadores definidos.D.     La entidad ha establecido, implementado y documentado un procedimiento para gestionar la transferencia de conocimiento asociado a los bienes y servicios de TI contratados por la entidad.','Ver numeral 2.2.4 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(134,18,1,'La entidad tiene la capacidad de planear, gestionar y gobernar los componentes de información.','A.      La entidad posee un modelo o esquema implementado de gobierno de la información alineado al marco de referencia de arquitectura empresarial para la gestión de TI del Estado colombiano, junto con su plan de implementación y la evidencia de la ejecución de dicho plan.B.      La entidad cuenta con una arquitectura de componentes de información documentada y actualizada (arquitectura AS-IS).','Ver numeral 2.3.1 G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado. ','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias.',1),(135,18,1,'La entidad tiene la capacidad de diseñar componentes de información','A.      La entidad posee y mantiene actualizado su mapa de información, el cual contiene los flujos de información internos y externos (con otras entidades). El conjunto de datos fuente de los flujos de información debe estar disponible en formatos que permitan su reutilización y procesamiento.B.      Las entidades cabezas de sector, poseen el mapa consolidado de información del sector.C.      La entidad posee actualizado el catálogo de componentes de información.D.     La entidad ha incorporado en el diseño de sus componentes de información (modelos de datos, servicios de información) el Lenguaje común para el intercambio de información.E.      La entidad debe tener publicado o expuesto al menos un servicio de información en el directorio de servicios de intercambio de información.','Ver numeral 2.3.2 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(136,18,1,'La entidad tiene la capacidad de realizar y estructurar procesos de análisis y aprovechamiento de los Componentes de Información para orientar la toma de decisiones. ','A.      La entidad debe establecer los Acuerdos de Intercambio de Información o equivalente con las dependencias y otras entidades, que contemple las características de oportunidad, disponibilidad, calidad y seguridad que requiera la información.\n\nB.      La entidad debe tener implementados y en funcionamiento mecanismos y herramientas que faciliten la consulta dinámica para el análisis y uso de la información por parte de los grupos de interés.\n\nC.      La entidad ha identificado y hace uso de las fuentes oficiales y únicas de información de acuerdo a la competencia de la entidad y permite su acceso de acuerdo a la clasificación de privacidad de la información, sin perder sus atributos de información: veraz, oportuna, confiable y reusable.D.     La entidad garantiza que la información para el análisis y la toma de decisiones se toman de la fuente oficial y los sistemas de información de la entidad, conservando los principios de veracidad, seguridad y oportunidad de la información.                                                                   D.     La entidad garantiza que la información para el análisis y la toma de decisiones se toman de la fuente oficial y los sistemas de información de la entidad, conservando los principios de veracidad, seguridad y oportunidad de la información.','Ver numeral 2.3.3 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(137,18,1,'La entidad tiene la capacidad de gestionar la calidad y seguridad de los Componentes de Información. ','A.      La entidad ha definido e implementado los roles y responsabilidades de la seguridad de la información, basados en las políticas de seguridad y privacidad de la información, conforme al modelo de privacidad y seguridad de la información del Estado.                                                                                                    B.      La entidad ha definido e implementado controles y mecanismos para alcanzar los niveles requeridos de seguridad privacidad y trazabilidad de los componentes de información.                                                                                                 C.      La entidad posee implementado y documentado un procedimiento para identificar y gestionar los riesgos relacionados con el uso de información. Este procedimiento hace parte del proceso para la gestión de TI definido por la entidad.                                                                                                                                               D.     La entidad ha diseñado un programa y/o estrategia de calidad de la información a nivel institucional que incluye etapas de aseguramiento, control e inspección y medición de indicadores de calidad.                                                E.      La entidad cuenta con mecanismos para asegurar la trazabilidad y auditoría sobre las acciones de creación, actualización, modificación o borrado de la información o cualquier otra que requiera la entidad para los sistemas de información desarrollados después de la publicación del Marco de Referencia de Arquitectura Empresarial del Estado o los sistemas de información identificados como de misión crítica de la entidad.  Para los sistemas de información ya existentes que no permitan generar trazas de auditoría, la entidad ha identificado un plan de actualización o ajuste.              F.      La entidad ha realizado acciones preventivas y correctivas de la calidad de la información.                                                                                                                             G.     La entidad ha implementado mecanismos que permiten a los consumidores de información el reporte y seguimiento de incidentes encontrados durante el uso de los servicios de información.','Ver numeral 2.3.4 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(138,18,1,'La entidad tiene la capacidad de planear y gestionar adecuadamente todos sus Sistemas de Información','A.      La entidad dispone de un catálogo actualizado de sistemas de información. Además, la entidad cabeza de sector cuenta con el directorio de sistemas de información sectorial.                                                                                        B.      La entidad realiza un proceso de planeación para la adquisición o construcción y despliegue de sus sistemas de información a partir del PETI. C.      La entidad tiene la arquitectura de sistemas de información de alto nivel documentada y actualizada, detalla cómo ésta soporta los componentes de información de la entidad y considera elementos de seguridad, integración e interoperabilidad, despliegue y la relación con otros dominios del Marco de Referencia de AE.                                                                                                                             D.     La entidad tiene implementado y documentado un procedimiento dentro del proceso de Gestión de TI, para el mantenimiento y/o actualización de los sistemas de información.','Ver numeral 2.4.1 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado ','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(139,18,1,'La entidad tiene la capacidad para diseñar sus Sistemas de Información bajo estándares y una arquitectura definida y con características de usabilidad, seguridad e interoperabilidad','A.      Los sistemas de Información de la entidad definidos como portales Digitales y los desarrollados a partir de la Expedición del Marco de Referencia de Arquitectura Empresarial incorporan los lineamientos y especificaciones técnicas de usabilidad y estilo definidas por la entidad y el Ministerio de TIC. La entidad ha incorporado en el diseño de los sistemas de información a partir de la expedición del Marco de Referencia, funcionalidades que faciliten la generación de datos abiertos.                                                                         B.      La entidad ha automatizado los procesos de extracción de los sistemas de información fuente, para la generación de conjuntos de datos abiertos. C.      La entidad incorpora en el diseño de sistemas de información los requerimientos de la institución, las restricciones funcionales y técnicas, y los atributos de calidad.                                                                                                                    D.     La entidad a partir de las necesidades de intercambio de información con otras entidades ha desarrollado los mecanismos necesarios para exponer su información y hace uso del Modelo de Interoperabilidad definido por el Estado.','Ver numeral 2.4.2 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(140,18,1,'La entidad tiene la capacidad para gestionar adecuadamente las etapas del ciclo de vida de los Sistemas de Información','A.      La entidad tiene definida y aplica metodologías de referencia para el desarrollo de todas las soluciones de software que la institución construye o adapta, independientemente de su tecnología.                                                         B.      La entidad ha establecido, documentado e implementado un procedimiento para el despliegue y estabilización de los sistemas de información.                                                                                                                                          C.      La entidad aplica un proceso formal de gestión de requerimientos de software durante todo el ciclo de vida de los sistemas de información. Esto aplica tanto para los desarrollos internos como para los desarrollos elaborados por proveedores. La entidad dentro del proceso de desarrollo de sistemas de información, ejecuta estrategias de integración continua e incremental de los nuevos desarrollos. La estrategia de integración continua, se realiza de manera automatizada.','Ver numeral 2.4.3 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(141,18,1,'La entidad tiene la capacidad para garantizar la entrega, evolución y adecuado soporte de los Sistemas de Información','A.      La entidad cuenta con la documentación funcional y técnica que facilite el mantenimiento, evolución y uso de sus sistemas de información. En el caso de sistemas de información en modalidad de Software como Servicio, la entidad debe poseer documentación funcional y Acuerdos de Nivel de Servicio (ANS).                                                                                                                                     B.      La entidad establece Acuerdos de Nivel de Servicio (ANS) cuando contrata con terceros el mantenimiento de los sistemas de información. Los ANS se deben aplicar en las etapas del ciclo de vida de los sistemas de Información que así lo requieran.                                                                                               C.      La entidad tiene establecido un procedimiento de gestión y soporte de incidencias y problemas sobre los sistemas de información.                                            D.     Para el mantenimiento y soporte de los componentes de software de los sistemas de información, la entidad hace análisis de impacto ante un cambio o modificación a dichos componentes, con el fin de determinar las acciones por seguir.','Ver numeral 2.4.4 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(142,18,1,'La entidad tiene la capacidad para asegurar la calidad y seguridad de los Sistemas de Información','A.      La entidad debe tener integrados los sistemas de información que soportan los procesos misionales, de forma que permita el intercambio de información de manera compatible y oportuna.                                                             B.      La entidad tiene identificados y gestiona los riesgos durante el ciclo de vida de los sistemas de información y ha implementado acciones para la mitigación de estos.                                                                                                                         C.      La entidad tiene implementado un mecanismo para gestión de la configuración y versionamiento sobre los sistemas de información y los artefactos relacionados.                                                                                                              D.     La entidad debe garantizar el cumplimiento de sus políticas y lineamientos de seguridad y privacidad de la información en sus sistemas de información.                                                                                                                                                  E.      La entidad debe definir e implementar un esquema de aseguramiento de calidad de los sistemas de información que cubra todo su ciclo de vida y asegure el cumplimiento de requerimientos funcionales y requerimientos no funcionales.                                                                                                                                                      F.      Los sistemas de información de la entidad, cuentan con mecanismos que aseguran el registro histórico de las acciones realizadas por los usuarios (trazabilidad)','Ver numeral 2.4.5 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(143,18,1,'La entidad tiene la capacidad de diseñar y gestionar una Arquitectura de Servicios Tecnológicos a través de lineamientos y estándares orientados a la definición y diseño de la Arquitectura de la infraestructura tecnológica que se requiere para soportar los Sistemas de Información y el portafolio de servicios de TI.','A.      La entidad dispone de un directorio actualizado de los servicios tecnológicos.                                                                                                                                              B.      La entidad posee una arquitectura de servicios tecnológicos documentada y actualizada.                                                                                                      C.      La arquitectura de servicios tecnológicos de la entidad permite y soporta el intercambio de información entre entidades externas y entre áreas de la misma entidad.                                                                                                                               D.     La entidad tiene definidas políticas de despliegue de servicios tecnológicos encaminados a minimizar los riesgos y garantizar la estabilidad de la operación.                                                                                                                                 E.      La entidad tiene implementados esquemas para una correcta disposición de residuos tecnológicos. ','Ver numeral 2.5.1 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(144,18,1,'La entidad tiene la capacidad de operar los de Servicios Tecnológicos, a través de la estructuración e implementación de los procesos de operación, monitoreo y supervisión de los Servicios Tecnológicos.','A.      La entidad evidencia la gestión de los servicios tecnológicos a través de la identificación de las capacidades utilizadas y demandadas y hace previsión de necesidades y capacidades de TI futuras requeridas basadas en: tendencias, previsiones de negocio, los Acuerdos de Niveles de Servicio – ANS existentes, cambios necesarios para adaptar la tecnología de TI a las novedades tecnológicas y las necesidades emergentes de la entidad.                 B.      La entidad gestiona y administra la disponibilidad de los servicios tecnológicos, a través de la identificación, monitoreo y control del nivel de consumo de los recursos que son compartidos por los servicios tecnológicos.                                                                                                                                               C.      La entidad evidencia que la infraestructura tecnológica soporta adecuadamente los servicios tecnológicos y cuenta con mecanismos de monitoreo que generan alertas tempranas ligadas a los umbrales de operación que la entidad ha definido.                                                                                          D.     La entidad posee un plan de continuidad del Negocio y recuperación ante desastres para sus sistemas de información e infraestructura tecnológica.','Ver numeral 2.5.2 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.                                                                         Plan de mantenimiento preventivo de la infraestructura y los Servicios Tecnológicos.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(145,18,1,'La entidad tiene la capacidad de dar Soporte a los Servicios Tecnológicos, por medio de la implementación y gestión de los procesos de soporte y mantenimiento de los Servicios Tecnológicos.','A.      La entidad tiene definido y documentado un esquema de soporte para atender los requerimientos de soporte de primer, segundo y tercer nivel, para sus servicios de TI, a través de un único punto de contacto: la mesa de servicio o similar.                                                                                                                                         B.      La entidad tiene definidos y hace seguimiento al cumplimiento de los Acuerdos de Niveles de Servicio – ANS para la mesa de servicio o similar. C.      La entidad tiene definidos Acuerdos de Niveles de Servicio – ANS para la provisión de servicios tecnológicos.                                                                                 D.     La entidad ha realizado y realiza monitoreo de los servicios tecnológicos para que estos estén disponibles, de acuerdo con los Acuerdos de Niveles de Servicio – ANS.                                                                                                                                  E.      La entidad ha aplicado y documentado un procedimiento para realizar mantenimientos preventivos periódicos sobre toda la infraestructura de servicios tecnológicos.','Ver numeral 2.5.3 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(146,18,1,'La entidad tiene la capacidad para Gestionar la calidad y seguridad de los Servicios Tecnológicos, gestionado los controles y mecanismos para alcanzar los niveles requeridos de seguridad y trazabilidad de los Servicios Tecnológicos.','A.      La entidad realiza gestión de los riesgos sobre la infraestructura de servicios tecnológicos a partir del establecimiento de controles asociados al acceso, trazabilidad, modificación o pérdida de información que atenten contra la disponibilidad, integridad y confidencialidad de la información.                     B.      La entidad cuenta con los niveles de seguridad informática sobre la infraestructura de servicios tecnológicos de acuerdo al modelo de seguridad de la información. ','Ver numeral 2.5.4 de G.GEN.04. Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado.','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(147,18,1,'La entidad tiene la capacidad de definir y aplicar una Estrategia para el Uso y Apropiación de TI','A.      La entidad ha definido e implementado una estrategia de uso y apropiación de TI que contiene al menos:                                                                                  ●       Matriz de caracterización y priorización de los grupos de interés involucrados e impactados por las iniciativas de TI.                                                     ●       Matriz de caracterización y priorización de los grupos de interés involucrados e impactados por las iniciativas de TI.                                                     ●       Acciones concretas para involucrar a todos los grupos de interés identificados.                                                                                                                                        ●       Identificación de las necesidades de sensibilización o formación del personal en temas relacionados con TI acorde con la estrategia de TI de la entidad.                                                                                                                                                    ●       Buenas prácticas en seguridad y privacidad de la información.                              B.      La entidad ha desarrollado un programa de formación y fortalecimiento de competencias en TI para sus servidores orientadas a:                                              ●       Desempeñar funciones esenciales de la entidad y resolver sus problemas.                                                                                                                                                ●       Responder a las necesidades estratégicas de la entidad.                                  ●       Tomar decisiones de negocio a partir de la gestión de TI.                                   ●       Desarrollar habilidades que permitan el uso adecuado de las tecnologías de la información y las comunicaciones.                                                   C.      La entidad tiene incluida dentro de la gestión de riesgos, la gestión de impactos y/o efectos asociados al uso y apropiación, derivados de la adopción de TI. Los efectos derivados de la implantación de los proyectos de TI, deben ser administrados de acuerdo al plan de gestión de impactos establecido.','Ver numeral 2.6.1 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado ','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(148,18,1,'La entidad tiene la capacidad para abordar y adaptarse a los cambios tecnológicos, y gestionar los efectos generados por éste.','A.      La entidad ha realizado y realiza procesos de gestión del cambio para facilitar el uso y apropiación de los proyectos de TI, incluyendo prácticas, procedimientos, recursos y herramientas necesarias.\n\nB.      La entidad ha realizado acciones de mejora y transformación de acuerdo a los indicadores de uso y apropiación de los proyectos de TI.\n\nC.      La entidad ha definido y medido indicadores de uso y apropiación para evaluar el nivel de adopción de la tecnología y la satisfacción en su uso y establecer mecanismos de medición de resultados en el uso y apropiación de TI.','Ver numeral 2.6.2 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(149,18,1,'La entidad tiene la capacidad para monitorear y evaluar los resultados e impacto en el uso y apropiación de TI','A.      La entidad realiza evaluaciones al plan de formación y gestión del cambio con el propósito de medir su eficacia.                                                                      B.      La entidad evalúa el entendimiento y apropiación de las buenas prácticas en seguridad y privacidad de la información por parte de los grupos de interés de la institución.                                                                                                          C.      La entidad ha realizado acciones de mejora a partir de los resultados generados en la evaluación de su estrategia de uso y apropiación.','Ver numeral 2.6.3 de G.GEN.04 Guía General de Evidencias del Marco de Referencia de Arquitectura Empresarial para la Gestión de TI en el Estado','','Indicar la característica de Generación de Valor y adjuntar soportes o evidencias',1),(150,18,2,'La entidad tiene la capacidad de diseñar e implementar una estrategia de TI soportada sobre un proceso de diseño, implementación y evolución de la arquitectura empresarial en las instituciones que genera un valor diferenciador.','A.      La entidad desarrolla su capacidad estratégica de TI, de manera que genera una práctica diferenciadora e innovadora con respecto a las demás entidades del sector al que pertenece o con entidades que poseen objetivos similares, en la formulación y planteamiento de la estrategia de TI, los procesos para el despliegue y la gestión de dichas definiciones estratégicas, impulsando la mejora continua en la gestión de TI y la atención al ciudadano.     B.      La entidad fomenta una cultura Innovación creando mecanismos que faciliten la participación y colaboración de los diferentes actores de interés incluyendo al ciudadano en la generación de nuevas iniciativas y proyectos que permitan a la entidad destacarse en su sector o entre entidades similares. Evidencia los resultados de los procesos de innovación a través de comportamientos y conductas visibles en productos, servicios y procesos de alto valor agregado.','La entidad debe sustentar como su estrategia de TI, es diferente e innovadora dentro de su sector, territorio o entre entidades similares.                                                                                                 Para esto la entidad debe presentar:                                                                ●       El proceso de diseño y concepción.                                                     ●       Metodología y el proceso ejecutado.                                                      ●       Resultados obtenidos.','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(151,18,2,'La entidad tiene la capacidad de gestionar su esquema de gobernabilidad de TI ','A.      La entidad gestiona y evalúa su modelo de modelo de gobierno de TI implementado con el propósito de optimizar y mejorar la gestión de TI. Los líderes de TI influencien sobre las decisiones estratégicas de la entidad.    B.      Para el caso de la entidad cabeza de sector, debe evidenciar el liderazgo y el ejercido de su rol de orientación a nivel sectorial demostrando que es un líder sectorial plenamente investido.','La entidad debe sustentar como hace gestión de su modelo de Gobierno de TI y cómo este fortaleció y optimizó la gestión de TI, posicionando a la entidad y diferenciándola dentro de su sector, territorio o entre entidades similares.                                        Para esto la entidad debe presentar:                                                   ●       El proceso de diseño y concepción.                                                    ●       Metodología y el proceso ejecutado.                                              ●       Resultados obtenidos.','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(152,18,2,'La entidad tiene la capacidad de gestionar el ciclo de vida de los datos, y mejorar la calidad de la información de tal forma que la información es un activo estratégico para la toma de decisiones y la creación de nuevos servicios.','A.      La entidad ha implementado mecanismos para gestionar el ciclo de vida de los datos y mejorar la calidad de la información en las entidades.                          B.      La entidad utiliza la información como un elemento diferenciador para mejorar la forma como se prestan o crean nuevos servicios para los grupos de interés y ciudadanos o impactar la distribución de recursos destinada a suplir sus necesidades.                                                                                                                 C.      La entidad ha implementado un programa y/o estrategia de calidad de la información a nivel institucional que incluye etapas de aseguramiento, control e inspección y medición de indicadores de calidad.','La entidad debe sustentar como su capacidad para gestionar y analizar su información, así como la mejora en la calidad de la información fortaleció la gestión de TI y la gestión institucional logrando que la gestión de la entidad se diferencie dentro de su sector, territorio o entre entidades similares.                                                                                                                  Para esto la entidad debe presentar:                                                       ●       El proceso de diseño y concepción.                                                    ●       Metodología y el proceso ejecutado.                                                 ●       Resultados obtenidos.','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(153,18,2,'La entidad tiene la capacidad para gestionar y evolucionar la arquitectura de los sistemas de información de la entidad de manera diferente e innovadora','A.      La entidad ha realizado procesos de reingeniería y automatización de procesos y procedimientos para el fortalecimiento, mejora de los sistemas de información  y el ofrecimiento de más y mejores trámites y servicios de cara al ciudadano.                                                                                                                                            B.      La actualización y/o mejoras sobe la arquitectura de sistemas de información de la entidad ha sido realizada a partir de los resultados del monitoreo y evaluación sobre los sistemas de información existentes y los principios de la Arquitectura Empresarial y los análisis desde las necesidades y tendencias tecnológicas.                                                                                                        C.      La entidad se diferencia del sector y entidades similares por la evolución y mejora en sus sistemas de información.','La entidad debe sustentar como la gestión de y evolución de la arquitectura de los sistemas de información fortaleció la gestión de TI, mejoró la toma de decisiones logrando que la entidad sea diferenciada dentro de su sector, territorio o entre entidades similares.                                                                                                      Para esto la entidad debe presentar:                                                                  ●       El proceso de diseño y concepción.                                                    ●       Metodología y el proceso ejecutado                                                  ●       Resultados obtenidos','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(154,18,2,'La entidad tiene la capacidad para gestionar eficientemente la infraestructura tecnológica que soporta los sistemas y servicios de información en las instituciones, generando un valor diferenciador','A.      La entidad posee una infraestructura tecnológica que soporta efectivamente los sistemas y servicios de información en las instituciones, garantizando la disponibilidad y operación permanente de los servicios tecnológicos, de tal forma que se convierta en una entidad que se diferencia por el soporte y calidad de los servicios y trámites prestados.                                         B.     La entidad ha implementado el modelo de seguridad y privacidad de la información exitosamente, demostrando que los resultados obtenidos a partir de la implementación son reconocidos dentro del sector y por fuera.','La entidad debe sustentar como la gestión de los servicios tecnológicos fortaleció la gestión de TI, logrando que la entidad se diferencie dentro de su sector, territorio o entre entidades similares.                                                                                         Para esto la entidad debe presentar:                                                          ●       El proceso de diseño y concepción.                                                ●       Metodología y el proceso ejecutado.                                                    ●       Resultados obtenidos.','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(155,18,2,'La entidad tiene la capacidad para diseñar e implementar estrategias y prácticas concretas innovadoras y creativas de uso y apropiación de TI que favorecen y apoyan la adopción del Marco de referencia de AE','A.      La entidad cuenta con un esquema o modelo de gestión del conocimiento y una estrategia de uso y apropiación implementado. Tanto el esquema de gestión de conocimiento como la estrategia de uso y apropiación de TI deben estar soportados en sistemas de información y en información relevante, de tal forma que, el conocimiento y las decisiones contribuyen a la creación de valor de manera sostenible y convirtiéndole como un elemento diferenciador en su sector.                                                              B.      La estrategia de uso y apropiación de la entidad es creativa e innovadora y evidencia factores o características que permiten diferenciar a la entidad en el uso y apropiación de TI.','La entidad debe sustentar como su modelo de gestión de conocimiento y su estrategia de uso y apropiación de TI diferencia a la entidad de otras entidades de su sector y como estos favorecen la adopción del Marco de Referencia de manera creativa y diferente.                                                                              Para esto la entidad debe presentar:                                                          ●       El proceso de diseño y concepción                                                  ●       Metodología y el proceso ejecutado                                                 ●       Resultados obtenidos','','Indicar la característica Diferenciadora y adjuntar soportes o evidencias',1),(156,18,3,'La entidad tiene la capacidad de implementar y evolucionar una estrategia de TI innovadora y transformadora que impacta el sector y su entorno. ','A.      La entidad debe evidenciar que aplica el enfoque de Arquitectura Empresarial y que esta práctica hace parte de sus procesos institucionales, logrando   crear una cultura organizacional donde el uso de las TIC es fundamental para conseguir resultados tangibles y procesos de alto valor agregado.                                                                                                                                                      B.      La estrategia de TI genera valor público y evidencia que, gracias a esta, la entidad se transforma y evoluciona para prestar más y mejores servicios continuamente.','La entidad deberá sustentar como su Estrategia de TI, le permite a la entidad transformarse y evolucionar continuamente y porque esta puede ser replicable en otros sectores y entidades.                                                                                   Para esto la entidad debe presentar:                                                       ●       El proceso de diseño y concepción                                           ●       Metodología y el proceso ejecutado                                                 ●       Resultados obtenidos','','Indicar la o las características que la hacen Transformadora y adjuntar soportes o evidencias',1),(157,18,3,'La entidad tiene la capacidad de evolucionar su modelo de gobernabilidad de TI e integrarlo con el esquema de gobierno corporativo, para facilitar y gestionar la transformación y evolución de la entidad.','A.      La entidad evidencia que ha revisado, actualizado y evolucionado su modelo de gobierno de TI.                                                                                                            B.      El modelo de gobierno de TI hace parte del gobierno corporativo de la entidad.                                                                                                                                                         C.      La entidad ha desarrollado dentro de su modelo de gobierno de TI prácticas que le permiten ser un referente transformador.','La entidad deberá indicar como su modelo o esquema de Gobierno de TI ha evolucionado, cómo está integrado al gobierno corporativo, porque puede ser replicable y contribuye a que la entidad sea transformadora dentro de su sector o país.                                                                                                        Para esto la entidad debe presentar:                                                   ●       El proceso de diseño y concepción.                                                 ●       Metodología y el proceso ejecutado.                                           ●       Resultados obtenidos. ','','Indicar la o las características que la hacen Transformadora y adjuntar soportes o evidencias',1),(158,18,3,'La entidad tiene la capacidad para aprovechar y hacer analítica de los datos que le permita ser un referente transformador.','A.      La entidad posee herramientas, estrategias, modelos entre otros que facilitan y favorecen el aprovechamiento y análisis de la información requeridos para transformar e impactar la gestión de la entidad y el sector.','La entidad deberá indicar cómo el aprovechamiento y análisis que hace de la información le permite distinguirse y lograr ser   una entidad transformadora dentro del sector o país.                              Para esto la entidad debe presentar:                                                      ●       El proceso de diseño y concepción.                                                  ●       Metodología y el proceso ejecutado.                                                ●       Resultados obtenidos ','','Indicar la característica Transformadora y adjuntar soportes o evidencias',1),(159,18,3,'La entidad tiene la capacidad para gestionar y evolucionar el diseño, gestión y soporte de sus sistemas de información con un enfoque transformador','A.      La entidad ha realizado procesos de automatización para gestionar y soportar los procesos institucionales a través de los sistemas de información que le permitan aportar en la transformación del sector y obtener resultados visibles en la gestión de la información.','La entidad deberá indicar cómo la gestión y soporte de sus Sistemas de Información, logran que la entidad sea transformadora dentro del sector y país. Así mismo debe soportar porque y como esta práctica de gestión y soporte puede ser replicable en otros sectores.                                                                 Para esto la entidad debe presentar:                                                          ●       El proceso de diseño y concepción                                                        ●       Metodología y el proceso ejecutado                                                  ●       Resultados obtenidos','','Indicar la característica Transformadora y adjuntar soportes o evidencias',1),(160,18,3,'La entidad tiene la capacidad evolucionar su infraestructura tecnológica y lograr la transformación de la entidad y sector.','A.      La entidad gestiona y evoluciona la arquitectura de los servicios tecnológicos a partir de la medición y evaluación de sus indicadores de gestión, así como del análisis de las tendencias tecnológicas y los lineamientos del sector. ','La entidad deberá sustentar cómo evoluciona su arquitectura tecnológica y como a partir de su evolución y la gestión de sus servicios tecnológicos convierten a la entidad en una entidad transformadora dentro del sector.\n\nPara esto la entidad debe presentar:\n\n●       El proceso de diseño y concepción \n●       Metodología y el proceso ejecutado\n●       Resultados obtenidos','','Indicar la característica Transformadora y adjuntar soportes o evidencias',1),(161,18,3,'La entidad tiene la capacidad para convertir la estrategia de uso y apropiación de TI en parte de la cultura organizacional y evolucionarla de tal forma que sea un factor transformador de la entidad.','A.      La entidad ha implementado una estrategia de uso y apropiación de TI, que hace parte de la cultura organizacional n y contribuye como un ente transformador en el impacto de los proyectos de TI.                                                                 B.      La estrategia de uso y apropiación de TI puede ser replicable en otros sectores y entidades del país.','La entidad deberá sustentar como su estrategia de uso y apropiación de TI puede ser replicada, como la estrategia fue incorporada dentro de la cultura organizacional y demás elementos que sea considerados como transformadores del sector y la entidad. Para esto la entidad debe presentar:                       ●       El proceso de diseño y concepción                                                     ●       Metodología y el proceso ejecutado                                                ●       Resultados obtenidos ','','Indicar la característica Transformadora y adjuntar soportes o evidencias',1);
